    return(

        <div className='user-header'>
            <p>Logo</p>

            <button>
                <a href="/myreservations">My Reservations</a>
            </button>
            <Routes>
            <Route path="/" element={<MyReservations/>} />

            </Routes>

            <button>logout</button>
        </div>

    )
}
